import React from 'react';

// Grid configuration based on user's measurements
const GRID_CONFIG = {
  boardWidth: 2000,
  boardHeight: 1426,
  gridLeft: 178,
  gridRight: 2000,
  gridTop: 185,
  gridBottom: 1414,
  cellWidth: 121.5,
  cellHeight: 122.9
};

const GRID_ROWS = 10;
const GRID_COLS = 15;

export default function GridAlignmentTest() {
  // Load board image as base64 (will be injected)
  const boardImage = "data:image/jpeg;base64,";

  return (
    <div style={{
      minHeight: '100vh',
      background: '#2C1810',
      padding: '20px',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center'
    }}>
      <h1 style={{ color: 'white', marginBottom: '20px' }}>
        Grid Alignment Test
      </h1>
      
      <div style={{
        background: 'white',
        padding: '20px',
        borderRadius: '10px',
        boxShadow: '0 10px 30px rgba(0,0,0,0.5)'
      }}>
        {/* Board container */}
        <div style={{
          position: 'relative',
          width: `${GRID_CONFIG.boardWidth}px`,
          height: `${GRID_CONFIG.boardHeight}px`,
          margin: '0 auto'
        }}>
          {/* Background board image */}
          <img 
            src={boardImage}
            alt="Game Board"
            style={{
              position: 'absolute',
              top: 0,
              left: 0,
              width: '100%',
              height: '100%',
              objectFit: 'cover'
            }}
          />
          
          {/* Grid overlay */}
          <div style={{
            position: 'absolute',
            left: `${GRID_CONFIG.gridLeft}px`,
            top: `${GRID_CONFIG.gridTop}px`,
            width: `${GRID_CONFIG.gridRight - GRID_CONFIG.gridLeft}px`,
            height: `${GRID_CONFIG.gridBottom - GRID_CONFIG.gridTop}px`,
            display: 'grid',
            gridTemplateColumns: `repeat(${GRID_COLS}, ${GRID_CONFIG.cellWidth}px)`,
            gridTemplateRows: `repeat(${GRID_ROWS}, ${GRID_CONFIG.cellHeight}px)`,
            gap: 0
          }}>
            {Array.from({ length: GRID_ROWS * GRID_COLS }).map((_, idx) => {
              const row = Math.floor(idx / GRID_COLS);
              const col = idx % GRID_COLS;
              
              // Highlight corners where workers start (red squares)
              const isCorner = 
                (row === 0 && col === 0) ||      // Top-left (Topsy)
                (row === 0 && col === 14) ||     // Top-right (Road)
                (row === 9 && col === 0) ||      // Bottom-left (River)
                (row === 9 && col === 14);       // Bottom-right (Turvy)
              
              return (
                <div
                  key={idx}
                  style={{
                    border: '1px solid rgba(255, 0, 0, 0.4)',
                    background: isCorner 
                      ? 'rgba(255, 215, 0, 0.6)'  // Gold for corners
                      : 'rgba(0, 255, 0, 0.15)',   // Light green for grid
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    fontSize: '10px',
                    color: 'rgba(0, 0, 0, 0.5)',
                    fontWeight: 'bold'
                  }}
                >
                  {isCorner && (
                    <div style={{
                      background: 'red',
                      color: 'white',
                      padding: '2px 4px',
                      borderRadius: '3px',
                      fontSize: '8px'
                    }}>
                      {row === 0 && col === 0 ? 'T' :
                       row === 0 && col === 14 ? 'R' :
                       row === 9 && col === 0 ? 'Riv' : 'Tu'}
                    </div>
                  )}
                  {!isCorner && `${col},${row}`}
                </div>
              );
            })}
          </div>
        </div>
        
        <div style={{
          marginTop: '20px',
          padding: '15px',
          background: '#f0f0f0',
          borderRadius: '5px'
        }}>
          <h3 style={{ margin: '0 0 10px 0' }}>Grid Info:</h3>
          <p style={{ margin: '5px 0', fontSize: '14px' }}>
            <strong>Grid position:</strong> Left: {GRID_CONFIG.gridLeft}px, Top: {GRID_CONFIG.gridTop}px
          </p>
          <p style={{ margin: '5px 0', fontSize: '14px' }}>
            <strong>Grid size:</strong> {GRID_CONFIG.gridRight - GRID_CONFIG.gridLeft}px  {GRID_CONFIG.gridBottom - GRID_CONFIG.gridTop}px
          </p>
          <p style={{ margin: '5px 0', fontSize: '14px' }}>
            <strong>Cell size:</strong> {GRID_CONFIG.cellWidth.toFixed(1)}px  {GRID_CONFIG.cellHeight.toFixed(1)}px
          </p>
          <p style={{ margin: '5px 0', fontSize: '14px' }}>
            <strong>Dimensions:</strong> {GRID_COLS} columns  {GRID_ROWS} rows
          </p>
          <div style={{ marginTop: '10px', fontSize: '12px', color: '#666' }}>
            <strong>Legend:</strong> Gold corners = Worker start positions (T=Topsy, R=Road, Riv=River, Tu=Turvy)
          </div>
        </div>
        
        <div style={{
          marginTop: '15px',
          padding: '15px',
          background: '#fff3cd',
          borderRadius: '5px',
          border: '1px solid #ffc107'
        }}>
          <h4 style={{ margin: '0 0 10px 0', color: '#856404' }}>
             CHECK: Does the green grid align with the board squares?
          </h4>
          <p style={{ margin: '5px 0', fontSize: '13px', color: '#856404' }}>
             The red borders should match the red lines on the board<br />
             Each green cell should cover one board square<br />
             Gold corners should be in the red corner squares<br />
             Grid coordinates (x,y) shown in each cell for reference
          </p>
        </div>
      </div>
    </div>
  );
}
